import "./App.css";
import Create from "./Create";
import {
  BrowserRouter,
  Switch, // instead of "Switch"
  Route,
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Switch>
        <Route exact path="/header">
          <div className="nav">
            <div className="left-section">
              <h1>Blog</h1>
            </div>
            <div className="left-section">
              <ul>
                <li>Create post</li>
                <li>Posts</li>
              </ul>
            </div>
          </div>

          <div className="container">
            <Create />
          </div>
        </Route>
      </Switch>
    </div>
  );
}

export default App;
